import React from 'react';
import { UncontrolledCarousel } from 'reactstrap';

const items = [
  {
    src: 'http://www.misspancake.co.uk/image/cache/data/category_13/toy-cubby-wooden-colorful-geometry-shapes-blocks-train-kids-toddlers-b01jmdf0tq-3265-500x500_0.jpg',
    altText: 'Slide 1',
    caption: 'Slide 1',
    header: 'Slide 1 Header',
    key: '1'
  },
  {
    src: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS8xQwO6ehwSFaga0_VjkmJ7ekNuAFC2XVlphjsQMLvpSxIhTeP&s',
    altText: 'Slide 2',
    caption: 'Slide 2',
    header: 'Slide 2 Header',
    key: '2'
  },
  {
    src: 'http://www.titianfinancial.net/image/cache/data/category_19/tulatoo-baby-toys-musical-instrument-set-fun-percussion-set-and-music-toy-for-babi-2620-500x500_0.jpg',
    altText: 'Slide 3',
    caption: 'Slide 3',
    header: 'Slide 3 Header',
    key: '3'
  }
];

const Car = () => <UncontrolledCarousel items={items} />;

export default Car;
